Мона́рхия (лат. monarchia от др.-греч. μοναρχία «единовластие» < μόνος «одиночный, единый» + ἀρχή «власть, господство») — форма правления, при которой главой государства является монарх, носящий соответствующий титул (король, царь, император, султан, эмир, фараон и т. д.). Монарх обладает неограниченным сроком полномочий, при этом его права могут быть ограничены законом, конституцией или парламентом. В зависимости от случая, власть монархов варьируется от абсолютной до сугубо-формальной. Как правило, должность главы государства при монархии передаётся по наследству. В современном мире чаще всего встречается парламентская монархия, при которой власть монарха является формальной, в то время как на деле государством управляет парламент. Основными признаками классической формы монархии (абсолютизма) являются: 
* существование единоличного главы государства, пользующегося своей властью пожизненно или до отречения (царь, король, император, шах); 
* как правило, наследственный (по обычаю или закону) порядок передачи верховной власти; 
* монарх олицетворяет единство нации, историческую преемственность традиции, представляет государство на международной арене; 
* юридический иммунитет и независимость монарха, которые подчёркивают институт контрасигнатуры. Часто государства, традиционно считающиеся монархическими, не удовлетворяют вышеперечисленным признакам. Более того, в некоторых случаях трудно точно провести грань между монархией и республикой. В Риме, например, существовала выборная монархия во время периода принципата. Речь Посполитая, будучи монархией, всё равно сохраняла свои республиканские институты. Европейский император, изначально, — республиканская чрезвычайная магистратура, а само название «Речь Посполитая» дословно переводится как «республика».
